import React from 'react';
import {makeStyles} from "@material-ui/core"
const useStyles=makeStyles({
    root:{
        display:"flex",
        flexDirection:"column",
        justifyContent:"center",
        alignItems:"center"
    }
})
const Index = () => {
    const classes=useStyles()
    return (
        <div className={classes.root}>
            <></>
        </div>
    );
}

export default Index;
